(1432, 'mb1253', '<p>Prioris generis est docilitas, memoria; Quid censes in Latino fore?.', '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Satis est tibi in te, satis in legibus, satis in mediocribus amicitiis praesidii. Sed tu istuc dixti bene Latine, parum plane. Huius, Lyco, oratione locuples, rebus ipsis ielunior. Nihil enim iam habes, quod ad corpus referas; Nihilo beatiorem esse Metellum quam Regulum. Duo Reges: constructio interrete. Certe nihil nisi quod possit ipsum propter se iure laudari. Quod autem principium officii quaerunt, melius quam Pyrrho; Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. Eorum enim omnium multa praetermittentium, dum eligant aliquid, quod sequantur, quasi curta sententia; Dolere malum est: in crucem qui agitur, beatus esse non potest. Tum mihi Piso: Quid ergo? </p>', 2, 5, 0, '2011-05-08 02:19:32', 0),
(1433, 'mb1254', '<p>Falli igitur possumus. Duo Reges: constructio interrete..', '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Qui enim voluptatem ipsam contemnunt, iis licet dicere se acupenserem maenae non anteponere. Quae cum essent dicta, discessimus. Duo Reges: constructio interrete. Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus; <b>Si id dicis, vicimus.</b> Illud dico, ea, quae dicat, praeclare inter se cohaerere. Nunc omni virtuti vitium contrario nomine opponitur. Memini vero, inquam; Uterque enim summo bono fruitur, id est voluptate. <i>Primum in nostrane potestate est, quid meminerimus?</i> Heri, inquam, ludis commissis ex urbe profectus veni ad vesperum. <i>Zenonis est, inquam, hoc Stoici.</i> </p>', 0, 1, 0, '2011-01-02 10:53:08', 0),
