(169, 'Vul hier de gegevens van uw algemeen contactpersoon in. Vul de voornaam en naam, emailadres, rechtstreeks telefoonnummer en faxnummer in. Telefoonnummers en faxnummers mogen enkel cijfers zijn inclusief de 00 landcode (vb.: 0032 voor Belgi√´ of 0031 voor Nederland)', 'Entrez les coordonn√©es de votre contact g√©n√©ral. Entrez le nom et pr√©nom, adresse e-mail, t√©l√©phone direct et le num√©ro de fax. Les num√©ros de t√©l√©phone et de fax peut seulement chiffres incluent le code 00 pays (par exemple 0032 pour la Belgique ou 0033 pour la France)', 'Geben Sie die Details Ihrer allgemeinen Kontakt. Geben Sie den Vor-und Nachnamen, E-Mail-Adresse, Telefon-und Faxnummer. Telefon-und Faxnummern darf nur Zahlen enthalten die 00 Landesvorwahl (zB 0049 f√ºr Deutschland)', 'Enter the details of your general contact. Enter the first and last name, email address, direct telephone and fax number. Phone and fax numbers may be only figures include the 00 country code (eg 0032 for Belgium)', 'intro_newcontact_firstcontact', 0),
(170, 'Duidt hier aan voor welke afdelingen deze persoon instaat. E√©n contactpersoon kan meerdere afdelingen hebben. Gebruik voor uw eerste contactpersoon steeds de afdeling algemeen, eventueel aangevuld met andere afdelingen.', 'Indiquez ici pour tous les d√©partements de cette personne est responsable. Un contact peut avoir plusieurs d√©partements. Les d√©partements peuvent √©galement √™tre appliqu√©s √† plusieurs contacts. Pour votre premier contact, utilisez le d√©partements g√©n√©ral, compl√©t√© √©ventuellement avec d''autres d√©partements.', 'Geben Sie hier f√ºr alle Abteilungen, die verantwortliche Person ist. Ein Kontakt kann mehreren Abteilungen. Abteilungen k√∂nnen auch mehrere Kontakte angewandt werden. F√ºr Ihren ersten Kontakt mit der allgemeinen Abteilung, m√∂glicherweise mit anderen Abteilungen erg√§nzt.', 'Indicate here for any departments that person is responsible. One contact can have multiple departments. Departments can also be applied to multiple contacts. For your first contact use the department generally, possibly supplemented with other departments.', 'intro_newcontact_departements', 0),
(171, 'Wenst u een extra contactpersoon toe te voegen, klik op deze knop en vul de gegevens en afdelingen aan.', 'Voulez-vous un contact suppl√©mentaire √† ajouter, cliquez sur ce bouton et remplissez les d√©tails et les d√©partements.', 'M√∂chten Sie eines weiteren Kontaktes hinzuf√ºgen, auf diesen Knopf und f√ºllen die Details und Abteilungen.', 'Would you like to add an additional contact, click on this button and fill in the details and departments.', 'intro_newcontact_addcontact', 0),
(172, 'Bent u klaar met het invullen van alle contactpersonen en afdelingen? Klik dan op deze knop om de contactpersonen op te slaan. Als er afdelingen zijn die u niet heeft aangeduid, dan worden deze afdelingen op de eerste contactpersoon geplaatst.', 'Lorsque vous avez fini de remplir tous les contacts et les d√©partements? Cliquez sur ce bouton pour enregistrer les contacts. S''il ya des d√©partements que vous n''avez pas identifi√©s, ces d√©partemenets sont plac√©es sur le premier contact.', 'Wenn Sie fertig sind Ausf√ºllen alle Kontakte und Abteilungen? Klicken Sie auf diese Knopf, um die Kontakte zu speichern. Wenn es Abteilungen von Ihnen nicht identifiziert sind, dann diese Abteilungen auf dem ersten Kontakt angeordnet.', 'When you have finished filling out all contacts and departments? Click this button to save the contacts. If there are departments that you have not identified, then these departments are placed on the first contact.', 'intro_newcontact_finish', 0),
