(1, 'Geachte mevrouw, heer', 'Bonjour madame, monsieur', 'Sehr geehrte Frau, Herr', 'Dear Madam, Sir', 'greeting', 0),
(2, 'Dank bij voorbaat &#124; Met vriendelijke groet', 'Merci d‚Äôavance &#124; Sinc&#232;rement', 'Danke ins Voraus &#124; Mit freundlichen Gr√º√üen', 'Thanks in advance &#124; Sincerely', 'thanks', 0),
(3, '<p>Welkom.</p> <p>Gelieve via onderstaande link, jullie gegevens zo correct en volledig mogelijk aan te vullen. Vergeet nadien zeker niet op de blauwe knop &ldquo;verzenden&rdquo; te klikken.<p>', '<p>Bienvenue.</p> <p>Merci de suivre le lien en bas et de remplir tous les infos le plus correct en complet que possible. N&#39;oubliez pas de cliquer sur le bouton &ldquo; envoyer &rdquo; √† la fin.</p>', '<p>Wilkimmen.</p> <p>Bitte die korrekte Daten so komplett wie m&#246;glich ausf√ºllen, durch auf unterem Link zu klicken. Vergessen Sie nachdem nicht auf den blauen Knopf &ldquo;versenden&rdquo; zu klicken.</p>', '<p>Welcome.</p> <p>Please click on the link below and fill out the form with your contact information as complete as possible. Don''t forget to hit the blue send button when your finished.</p>', 'newcontact', 0),
(4, 'Welkom', 'Bienvenue', 'Wilkimmen', 'Welcome', 'subject_welcome', 0),
(5, 'Nieuwe contactpersonen die zijn opgeslagen door de klant ', 'Nouveaux contacts sauv√©s par le client ', 'Neue Kontakte gespeichert durch den Kunden ', 'New contacts saved by customer ', 'subject_newcontact_saved', 0);
